import React from "react";
import "../styles/Footer.css";
import { FaFacebookF, FaInstagram, FaTiktok, FaYoutube, FaSpotify, FaWhatsapp } from "react-icons/fa";

const Footer = () => {
  return (
    <footer className="main-footer">
      <p>Â© {new Date().getFullYear()} SOUNDMILES MUSIC | All Rights Reserved</p>

      <div className="social-icons">
        <a href="https://facebook.com" target="_blank" rel="noopener noreferrer" title="Facebook">
          <FaFacebookF />
        </a>
        <a href="https://instagram.com" target="_blank" rel="noopener noreferrer" title="Instagram">
          <FaInstagram />
        </a>
        <a href="https://tiktok.com" target="_blank" rel="noopener noreferrer" title="TikTok">
          <FaTiktok />
        </a>
        <a href="https://youtube.com" target="_blank" rel="noopener noreferrer" title="YouTube">
          <FaYoutube />
        </a>
        <a href="https://spotify.com" target="_blank" rel="noopener noreferrer" title="Spotify">
          <FaSpotify />
        </a>
        <a href="https://wa.me/1234567890" target="_blank" rel="noopener noreferrer" title="WhatsApp">
          <FaWhatsapp />
        </a>
      </div>
    </footer>
  );
};

export default Footer;
